import React from 'react'
import './Card.css'

function Card(props) {
    return (
        <div className='card-container'>
            <div className='image-container'>
                <img src='https://www.centralparknyc.org/park-history' alt='image'/>
            </div>
        </div>
    );
}

export default Card;
